) ENGINE=InnoDB AUTO_INCREMENT=2001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Спецификация к конкретной продукции коллекции, как правило несколько строк (позиций)';
