CREATE TABLE `planned_limit` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `price_id` bigint unsigned NOT NULL COMMENT 'ссылка на ценовую позицию',
  `change_at` date NOT NULL COMMENT 'изменения на дату',
