--
-- Final view structure for view `catalog_books`
--

/*!50001 DROP VIEW IF EXISTS `catalog_books`*/;
/*!50001 SET @saved_cs_client          = @@character_set_client */;
/*!50001 SET @saved_cs_results         = @@character_set_results */;
/*!50001 SET @saved_col_connection     = @@collation_connection */;
/*!50001 SET character_set_client      = utf8mb4 */;
/*!50001 SET character_set_results     = utf8mb4 */;
/*!50001 SET collation_connection      = utf8mb4_0900_ai_ci */;
/*!50001 CREATE ALGORITHM=UNDEFINED */
/*!50013 DEFINER=`root`@`127.0.0.1` SQL SECURITY DEFINER */
/*!50001 VIEW `catalog_books` AS select (case when ((select avg(`price`.`limit_current`) from `price` where (`c`.`id` = `price`.`coll_id`)) = 0) then concat('Out of Stock – Book: ',`c`.`name`) when ((`c`.`magnum_edition` = 1) and ((`c`.`signed` <> 'Signed') or (`c`.`signed` is null))) then concat('Magnum Editions Book: ',`c`.`name`) when ((`c`.`magnum_edition` = 1) and (`c`.`signed` = 'Signed')) then concat('Signed Magnum Editions Book: ',`c`.`name`) when ((`c`.`tags` = 'Rare Books') and ((`c`.`signed` <> 'Signed') or (`c`.`signed` is null))) then concat('Rare Book: ',`c`.`name`) when ((`c`.`tags` = 'Rare Books') and (`c`.`signed` = 'Signed')) then concat('Singned Rare Book: ',`c`.`name`) when ((`c`.`signed` <> 'Signed') or (`c`.`signed` is null)) then concat('Book: ',`c`.`name`) when (`c`.`signed` = 'Signed') then concat('Signed Book: ',`c`.`name`) end) AS `title`,`p2`.`name` AS `author`,(select min(`price`.`price`) from `price` where (`c`.`id` = `price`.`coll_id`)) AS `price`,`c`.`edition` AS `edition`,(select if((`c`.`magnum_edition` = 1),'Magnum Editions','')) AS `isMagnum`,`c`.`signed` AS `signed`,(select `cp`.`url` from `coll_photos` `cp` where (`cp`.`coll_id` = `c`.`id`) order by `cp`.`main` desc limit 1) AS `url`,`c`.`id` AS `id` from (`collections` `c` join `photographers` `p2` on((`c`.`author` = `p2`.`id`))) where (`c`.`type` = 'Books') order by rand() */;
/*!50001 SET character_set_client      = @saved_cs_client */;
/*!50001 SET character_set_results     = @saved_cs_results */;
/*!50001 SET collation_connection      = @saved_col_connection */;

