/*!50001 VIEW `catalog_posters` AS select (case when ((select avg(`price`.`limit_current`) from `price` where (`c`.`id` = `price`.`coll_id`)) = 0) then concat('Out of Stock – Poster: ',`c`.`name`) when ((`c`.`magnum_edition` = 1) and ((`c`.`signed` <> 'Signed') or (`c`.`signed` is null))) then concat('Magnum Collection Poster: ',`c`.`name`) when ((`c`.`magnum_edition` = 1) and (`c`.`signed` = 'Signed')) then concat('Signed Magnum Collection Poster: ',`c`.`name`) when ((`c`.`tags` = 'Vintage Posters') and ((`c`.`signed` <> 'Signed') or (`c`.`signed` is null))) then concat('Vintage Poster: ',`c`.`name`) when ((`c`.`tags` = 'Vintage Posters') and (`c`.`signed` = 'Signed')) then concat('Singned Vintage Poster: ',`c`.`name`) when ((`c`.`tags` = 'Contemporary Posters') and ((`c`.`signed` <> 'Signed') or (`c`.`signed` is null))) then concat('Contemporary Poster: ',`c`.`name`) when ((`c`.`tags` = 'Contemporary Posters') and (`c`.`signed` = 'Signed')) then concat('Signed Contemporary Poster: ',`c`.`name`) end) AS `title`,`p2`.`name` AS `author`,(select min(`price`.`price`) from `price` where (`c`.`id` = `price`.`coll_id`)) AS `price`,`c`.`edition` AS `edition`,(select if((`c`.`magnum_edition` = 1),'Magnum Editions','')) AS `isMagnum`,`c`.`signed` AS `signed`,(select `cp`.`url` from `coll_photos` `cp` where (`cp`.`coll_id` = `c`.`id`) order by `cp`.`main` desc limit 1) AS `url`,`c`.`id` AS `id` from (`collections` `c` join `photographers` `p2` on((`c`.`author` = `p2`.`id`))) where (`c`.`type` = 'Posters') order by rand() */;
/*!50001 SET character_set_client      = @saved_cs_client */;
/*!50001 SET character_set_results     = @saved_cs_results */;
/*!50001 SET collation_connection      = @saved_col_connection */;

